items.template:
Value SERVICE_ID (\d+)
Value CUSTOMER_ID (\d+)
Value DESCRIPTION ([\w|\s]+|\(Not\sSpecified\))
Value ADMIN_STATE ([uU][pP]|[Dd][oO][wW][nN])
Value OPER_STATE ([uU][pP]|[Dd][oO][wW][nN])
Value SAP_COUNT ([0-9]{1,1500})
Value SDP_COUNT ([0-9]{1,150})
Value MTU (\d+)

Start
  ^Customer\sId\s+.\s${CUSTOMER_ID}
  ^MTU\s+:\s${MTU}
  ^Service\sId\s+:\s${SERVICE_ID}
  ^Description\s+:\s${DESCRIPTION}
  ^Admin\sState\s+:\s${ADMIN_STATE}\s+Oper\sState\s+:\s${OPER_STATE}
  ^SAP\sCount\s+:\s${SAP_COUNT}\s+SDP\sBind\sCount\s+:\s${SDP_COUNT} -> Record

Value Filldown INTERFACE (\S+)
Value CKN (\S+)
Value MESSAGE_ID (\S+)
Value ELECTED_SELF (\S+)
Value SUCCESS (\S+)
Value PRINCIPAL (\S+)
Value DEFAULT (\S+)
Value KEY_SERVER_SCI (\S+)
Value SAK_TRANSMIT (\S+)
Value LLPN_EXHAUSTION (\S+)
Value DISTRIBUTED_KEY_ID (\S+)
Value LIVE_PEER_LIST (\S+)
Value POTENTIAL_PEER_LIST (\S+)

Start
  ^Interface:\s+${INTERFACE} -> Ckn1

Ckn1
  ^\s+CKN:\s+${CKN}
  ^\s+Message ID:\s+${MESSAGE_ID}
  ^\s+Elected self:\s+${ELECTED_SELF}
  ^\s+Success:\s+${SUCCESS}
  ^\s+Principal:\s+${PRINCIPAL}
  ^\s+Default:\s+${DEFAULT}
  ^\s+KeyServer SCI:\s+${KEY_SERVER_SCI}
  ^\s+SAK transmit:\s+${SAK_TRANSMIT}
  ^\s+LLPN exhaustion:\s+${LLPN_EXHAUSTION}
  ^\s+Distributed key identifier:\s+${DISTRIBUTED_KEY_ID}
  ^\s+Live peer list:\s+${LIVE_PEER_LIST}
  ^\s+Potential peer list:\s+${POTENTIAL_PEER_LIST} -> Record
  ^\s+$$
  ^$$ -> Ckn2
  ^.* -> Error "LINE NOT FOUND"

Ckn2
  ^\s+CKN:\s+${CKN}
  ^\s+Message ID:\s+${MESSAGE_ID}
  ^\s+Elected self:\s+${ELECTED_SELF}
  ^\s+Success:\s+${SUCCESS}
  ^\s+Principal:\s+${PRINCIPAL}
  ^\s+Default:\s+${DEFAULT}
  ^\s+KeyServer SCI:\s+${KEY_SERVER_SCI}
  ^\s+SAK transmit:\s+${SAK_TRANSMIT}
  ^\s+LLPN exhaustion:\s+${LLPN_EXHAUSTION}
  ^\s+Distributed key identifier:\s+${DISTRIBUTED_KEY_ID}
  ^\s+Live peer list:\s+${LIVE_PEER_LIST}
  ^\s+Potential peer list:\s+${POTENTIAL_PEER_LIST} -> Record
  ^\s+$$
  ^$$ -> Start
  ^.* -> Error "LINE NOT FOUND"

EOF

Value DOMAIN (.*)
Value INTERFACE (\S+)
Value PEER_ADDR (\S+)
Value PEER_LINK (\S+)
Value STATE (\S+)

Start
  ^domain-id\s+:\s+${DOMAIN} 
  ^local-interface\s+:\s+${INTERFACE}
  ^peer-address\s+:\s+${PEER_ADDR}
  ^peer-link\s+:\s+${PEER_LINK} 
  ^state\s+:\s+${STATE} -> Record

Value NAME (\S+)
Value ACCESS (\S+)
Value VIEW (\S+)
Value ACL (\S+)

Start
  ^Community\sview:\s+${VIEW}
  ^.*list:\s+${ACL}
  ^Community\sname:\s+${NAME}
  ^Community\saccess:\s+${ACCESS} 
  ^.* -> Record
  #^Community\svies:\s+${VIEW}
  #^Access\slist:\s+${ACL} -> Record

Value MODEL (\S+)
Value HW_VERSION (\S+)
Value SERIAL_NUMBER (\S+)
Value SYS_MAC (\S+)
Value IMAGE (\S+)
Value TOTAL_MEMORY (\d+)
Value FREE_MEMORY (\d+)

Start
  ^Arista\s+${MODEL}
  ^Hardware\s+version:\s+${HW_VERSION}
  ^Serial\s+number:\s+${SERIAL_NUMBER}
  ^System\s+MAC\s+address:\s+${SYS_MAC}
  ^Software\s+image\s+version:\s+${IMAGE}
  ^Total\s+memory:\s+${TOTAL_MEMORY}
  ^Free\s+memory:\s+${FREE_MEMORY} -> Record

Value Required interface (\d+)
Value portname ([0-9a-zA-Z\ \-\"\/\(\)\_\#\@\.\'\!\&]+)
Value qostostrust ([a-z\-]+)
Value qostosmark ([a-z\-]+)
Value ospfarea (\d+)
Value ospfpassive (passive)
Value ospfcost (\d+)
Value vrf ([a-zA-Z0-9]+)
Value ippimsparse (pim-sparse)
Value iprouterisis (isis)
Value isismetric (\d+)
Value iphelpers (\d+)
Value ipaddresses (\d+)
Value ipredirect (no)

Start
  ^interface ve ${interface}
  ^\s+port-name\s+${portname}
  ^\s+qos-tos trust ${qostostrust}
  ^\s+qos-tos mark ${qostosmark}
  ^\s+ip ospf area ${ospfarea}
  ^\s+ip ospf ${ospfpassive}
  ^\s+ip ospf cost ${ospfcost}
  ^\s+vrf forwarding ${vrf}
  ^\s+ip ${ippimsparse}
  ^\s+ip router ${iprouterisis}
  ^\s+isis metric ${isismetric}
  ^\s+${ipredirect} ip redirect
  ^! -> Next.Record

Value topogroup (\d+)
Value topohwindex (\d+)
Value mastervlan (\d+)
Value l2proto (MRP|STP|RSTP|VSRP|ERP)
Value vplsvlanpresent (TRUE|FALSE)
Value membervlans ([0-9\ to]+)
Value membergroup ([0-9a-zA-Z\/\ ]+)
Value controlports ([0-9\ \/eto]+)
Value freeports ([0-9\ \/eto]+)

Start
  ^Topology Group\s+${topogroup}
  ^Topo HW Index\s+${topohwindex}
  ^Master VLAN\s+:\s+${mastervlan}
  ^L2 Protocol\s+:\s+${l2proto}
  ^VPLS VLAN exist\s+:\s+${vplsvlanpresent}
  ^Member VLAN\s+:\s+${membervlans}
  ^Member Group\s+:\s+${membergroup}
  ^Control Ports\s+:\s+${controlports}
  ^Free -> Record

Value INTERFACE (\S+)
Value STATE (\w+)
Value MAC (.*)
Value TYPE (\S+)
Value LINK_STATE (.*)
Value MTU (\d+)
Value AUTONEG (.*)
Value SPEED (.*)
Value COMMENT (\S.*)
Value IPV4_ADDRESS ((?:[0-9]{1,3}\.){3}[0-9]{1,3}(/\d{1,2})?|\w+)
Value IPV6_ADDRESS ([0-9a-f:]*)
Value IPV6_LL_ADDRESS ([0-9a-f:]*)
Value IPV6_LL_MASK (\d+)


Start
  ^Interface\s${INTERFACE}
  ^\s+state\s${STATE}
  ^\s+mac-addr\s${MAC}
  ^\s+type\s${TYPE}
  ^\s+link-state\s${LINK_STATE}
  ^\s+mtu\s${MTU}
  ^\s+auto-negotiation\s${AUTONEG}
  ^\s+speed\s${SPEED}
  # sometimes the comment is enclosed in braces
  ^\s+comments\s${COMMENT}\s*$$
  ^\s+ipv4-address\s${IPV4_ADDRESS}\s*$$
  ^\s+ipv6-address\s${IPV6_ADDRESS}\s*$$
  ^\s+ipv6-local-link-address\s${IPV6_LL_ADDRESS}/${IPV6_LL_MASK}
  ^Statistics: -> Record

Value VERSION (\S+)
Value BUILD (\S+)
Value KERNEL (\S+)
Value ARCHITECTURE (\S+)

Start
  ^Product version Check Point Gaia\s${VERSION}
  ^OS build\s${BUILD}
  ^OS kernel version\s${KERNEL}
  ^OS edition\s${ARCHITECTURE}-bit -> Record

Value VERSION (\S+)
Value DEVICE_MGR_VERSION (\S+)
Value IMAGE (\S+)
Value HOSTNAME (\S+)
Value UPTIME (.+)
Value HARDWARE (.+)
Value MODEL (\S+)
Value FLASH (\S+)
Value List INTERFACES (\S+)
Value LICENSE_MODE (.+)
Value LICENSE_STATE (.+)
Value MAX_INTF (\d+)
Value MAX_VLANS (\d+)
Value FAILOVER (\S+)
Value CLUSTER (\S+)
Value SERIAL (\S+)
Value LAST_MOD (.+)

Start
  ^.*Software\sVersion\s${VERSION}
  ^Device.+\s${DEVICE_MGR_VERSION}
  ^System image file.+"${IMAGE}"
  ^${HOSTNAME} up ${UPTIME}
  ^Hardware:\s+${HARDWARE},
  ^Model Id:\s+${MODEL}
  ^Internal.+Flash,\s${FLASH}
  ^ \d+:.\S+\s${INTERFACES}.*
  ^License mode:\s${LICENSE_MODE}
  ^.+License State:\s${LICENSE_STATE}
  ^Maximum Physical.+:\s${MAX_INTF}
  ^Maximum VLANs.+:\s${MAX_VLANS}
  ^Failover\s+:\s${FAILOVER}
  ^Cluster\s+:\s${CLUSTER}
  ^Serial Number:\s${SERIAL}
  ^.+last modified by\s${LAST_MOD}

Value Filldown CHASSIS_TYPE (.*?)
Value Required SLOT_NUMBER ((?:.*)[A-Z]\d+(?:.*))
Value MODULE_SKU (.+?)
Value STATE (.+)
Value RUNNING_STATE (.+)
Value INTERNAL_STATE (.+)
Value INTERNAL_OPERATIONAL_STATE (.+)
Value INSERT_TIME (.*)
Value UPTIME (.*)
Value HARDWARE_SIGNAL (.*)
Value PACKET_SIGNAL (.*)

Start
  ^Chassis type: ${CHASSIS_TYPE}(?:\s|$$)
  ^.*(?:Sub-slot|Slot):\s${SLOT_NUMBER}\,(?:\s${MODULE_SKU}|\s+$$)(?:\s+|$$)
  ^\s+State\s*\:\s${STATE}
  ^.*Running state\s*\:\s${RUNNING_STATE}
  ^.*Internal state\s*\:\s${INTERNAL_STATE}
  ^.*Internal operational state\s*\:\s${INTERNAL_OPERATIONAL_STATE}
  ^.*Physical insert detect time\s*\:\s${INSERT_TIME}
  ^.*Software declared up time\s*\:\s${UPTIME}
  ^.*Hardware ready signal time\s*\:\s${HARDWARE_SIGNAL}
  ^.*Packet ready signal time\s*\:\s${PACKET_SIGNAL}
  ^$$ -> Record

Value VERSION (\d)
Value DOMAIN (\S+)
Value PRUNING (\S+)
Value TRAPS (\S+)
Value DEVICE_ID (\S+)
Value LAST_MODIFIED_SERVER (\d+.\d+.\d+.\d+)
Value LAST_MODIFIED_DATE (\d+-\d+-\d+\s\d+:\d+:\d+)
Value LOCAL_UPDATER_ADDR (\d+.\d+.\d+.\d+)
Value LOCAL_UPDATER_IFACE (\S+)
Value MODE (\w+)
Value MAX_VLANS (\d+)
Value EXISTING_VLAN_COUNT (\d+)
Value REVISION_NUMBER (\d+)

Start
  ^VTP\s+[v,V]ersion\s+[r,R]unning\s+:\s${VERSION}
  ^VTP\s+[d,D]omain\s+[n,N]ame\s+:\s${DOMAIN}
  ^VTP\s+[p,P]runing\s+[m,M]ode\s+:\s${PRUNING}
  ^VTP\s+[t,T]raps\s+[g,G]eneration\s+:\s${TRAPS}
  ^[d,D]evice\s+ID\s+:\s${DEVICE_ID}
  ^\w+\s\w+\s\w+\s\w+\s${LAST_MODIFIED_SERVER}\s\w+\s${LAST_MODIFIED_DATE}
  ^\w+\s\w+\s\w+\s\w+\s${LOCAL_UPDATER_ADDR}\s\w+\s\w+\s${LOCAL_UPDATER_IFACE}\s.*
  ^VTP\s[o,O]perating\s[m,M]ode\s+:\s${MODE}
  ^Maximum\sVLANs\s[s,S]upported\s[l,L]ocally\s+:\s${MAX_VLANS}
  ^Number\sof\sexisting\sVLANs\s+:\s${EXISTING_VLAN_COUNT}
  ^Configuration\s[r,R]evision\s+:\s${REVISION_NUMBER} -> Record

Value Filldown INTERFACE (\S+)
Value Required CTS_STATUS (\w+)
Value CTS_MODE (\S+)
Value IFC_STATE (\S+)
Value AUTHENTICATION_STATUS (\S+)
Value PEER_IDENTITY ((\S+(\s\S+)*))
Value PEER_IS ((\S+(\s\S+)*))
Value DOT1X_ROLE (\S+)
Value AUTHORIZATION_STATUS (\S+)
Value PEER_SGT (\d+)
Value PEER_SGT_ASSIGNMENT ((\S+(\s\S+)*))
Value SAP_STATUS (\S+)
Value SGT_PROPAGATE (\S+)

Start
  ^CTS\s+Information\s+for\s+Interface\s+${INTERFACE}: -> Interface

Interface
  ^\s+CTS\s+is\s+${CTS_STATUS},\s+mode:\s+${CTS_MODE}
  ^\s+IFC\s+state:\s+${IFC_STATE}
  ^\s+Authentication\s+Status:\s+${AUTHENTICATION_STATUS}
  ^\s+Peer\s+Identity:\s+${PEER_IDENTITY}
  ^\s+Peer\s+is:\s+${PEER_IS}
  ^\s+802.1X\s+role:\s+${DOT1X_ROLE}
  ^\s+Authorization\s+Status:\s+${AUTHORIZATION_STATUS}
  ^\s+PEER\s+SGT:\s+${PEER_SGT}
  ^\s+Peer\s+SGT\s+assignment:\s+${PEER_SGT_ASSIGNMENT}
  ^\s+SAP\s+Status:\s+${SAP_STATUS}
  ^\s+Propagate\s+SGT:\s+${SGT_PROPAGATE} -> Record Start

Value FEX (\d+)
Value DESCRIPTION (\S+)
Value STATE (\S+)
Value VERSION (\S+)
Value EXTENDER_SERIAL (\S+)
Value EXTENDER_MODEL (\S+)
Value PART_NO (\S+)
Value PINNING_MODE (\w+)
Value MAX_LINKS (\d+)
Value FABRIC_PORT (\S+)
Value FCOE_ADMIN (\w+)
Value FCOE_OPER (\w+)
Value FCOE_FEX_AA_CONFIGURED (\w+)
Value List FABRIC_INTERFACE (\S+)
Value List INTERFACE_MODE (\w+)
Value List INTERFACE_STATE (\w+)

Start
  ^FEX:\s+${FEX}\s+Description:\s+${DESCRIPTION}\s+state:\s+${STATE}
  ^.*FEX\s+version:\s+${VERSION}
  ^.*Extender\s+Serial:\s+${EXTENDER_SERIAL}
  ^.*Extender\s+Model:\s+${EXTENDER_MODEL},.*Part\s+No:\s+${PART_NO}
  ^.*Pinning\-mode:\s+${PINNING_MODE}.*Max\-links:\s+${MAX_LINKS}
  ^.*Fabric\s+port\s+for\s+control\s+traffic:\s+${FABRIC_PORT} 
  ^.*FCoE\s+Admin:\s+${FCOE_ADMIN}
  ^.*FCoE\s+Oper:\s+${FCOE_OPER}  
  ^.*FCoE\s+FEX\s+AA\s+Configured:\s+${FCOE_FEX_AA_CONFIGURED} 
  ^\s+${FABRIC_INTERFACE}\s+\-\s+Interface\s+${INTERFACE_MODE}\.\s+State:\s+${INTERFACE_STATE} 
  ^\S -> Record

Value UPTIME ((\d+\s\w+.s.,?\s?){4})
Value LAST_REBOOT_REASON (\w+)
Value OS (\d+.\d+(.+)?)
Value BOOT_IMAGE (.*)
Value PLATFORM (\w+)

Start
  ^\s+(NXOS: version|system:\s+version)\s${OS}
  ^\s+(NXOS|kickstart) image file is:\s${BOOT_IMAGE}
  ^\s+cisco Nexus\d+\s${PLATFORM}
  ^Kernel uptime is\s${UPTIME}
  ^\s+Reason:\s${LAST_REBOOT_REASON} -> Record

Value PRODUCT_VERSION (.*)
Value BOOTLOADER_VERSION (.*)
Value FIELD_RECOVERY_IMAGE_VERSION (.*)
Value FIRMWARE_VERSION (.*)
Value BUILD_TYPE (.*)
Value SYSTEM_NAME (.*)
Value SYSTEM_LOCATION (.*)
Value SYSTEM_CONTACT (.*)
Value IP_ADDRESS (.*)
Value LAST_RESET (.*)
Value SYSTEM_UP_TIME (.*)
Value SYSTEM_TIMEZONE_LOCATION (.*)
Value CONFIGURED_COUNTRY (.*)
Value NUMBER_WLANS (\d+)
Value NUMBER_ACTIVE_CLIENTS (\d+)
Value MAC_ADDRESS (.*)
Value MAXIMUM_APS (\d+)

Start
  ^Product Version\.+\s${PRODUCT_VERSION}
  ^Bootloader Version\.+\s${BOOTLOADER_VERSION}
  ^Field Recovery Image Version\.+\s${FIELD_RECOVERY_IMAGE_VERSION}
  ^Firmware Version\.+\s${FIRMWARE_VERSION}
  ^Build Type\.+\s${BUILD_TYPE}
  ^System Name\.+\s${SYSTEM_NAME}
  ^System Location\.+\s${SYSTEM_LOCATION}
  ^System Contact\.+\s${SYSTEM_CONTACT}
  ^IP Address\.+\s${IP_ADDRESS}
  ^Last Reset\.+\s${LAST_RESET}
  ^System Up Time\.+\s${SYSTEM_UP_TIME}
  ^System Timezone Location\.+\s${SYSTEM_TIMEZONE_LOCATION}
  ^Configured Country\.+\s${CONFIGURED_COUNTRY}
  ^Number of WLANs\.+\s${NUMBER_WLANS}
  ^Number of Active Clients\.+\s${NUMBER_ACTIVE_CLIENTS}
  ^Burned-in MAC Address\.+\s${MAC_ADDRESS}
  ^Maximum number of APs supported\.+\s${MAXIMUM_APS} -> Record
